  "about_content": "<h2>عن هذا التطبيق</h2><p>تم توفير هذا التطبيق لكم من قبل <b>فارما ليدجر</b>.وقد تم تطويره بشكل مشترك من قبل منظمات تمثيل المرضى، شركات الأدوية، وخبراء التكنولوجيا.</p><p>فهو يتيح  لمستخدميهعرض معلومات حول أدويتهم عن طريق مسح الباركود الموجود على عبوة المنتج.</p><p>يتم توفير المعلومات المعروضة من قبل صاحب ترخيص تسويق المنتج.</p><h2>حول فارما ليدجر</h2><p>PharmaLedger® هو الاسم التجاري لجمعية PharmaLedger (PLA).</p><p>هي جمعية عالمية محايدة غير ربحية. الغرض من الجمعية هو إنشاء وتعزيز نظام بيئي للثقة الرقمية في مجال الرعاية PLA الصحية.</p><p>تعمل الجمعية على تعزيز التعاون في قطاعي الرعاية الصحية وعلوم الحياة وتشجع الابتكارات وتنفيذها من أجل المنفعة المتبادلة للمرضى وأصحاب المصلحة الآخرين.</p>",
  "help_modal_title": "مساعدة",
