  "help_content": "<div><h2>ما هوEPI ؟ </h2><p><b>EPI</b>هو اختصار ل<b>معلومات المنتج الإلكترونية</b>. إنها نسخة إلكترونية من نشرة معلومات المنتج الورقية التي تجدها عادةً داخل عبوة المنتج الصيدلاني. في بعض الحالات، قد تحل نسخة <b>EPI</b> محل النشرة الورقية.</p><h2>ما هو فارما ليدجر؟</h2><p>جمعية فارما ليدجر (PLA) هي جمعية غير هادفة للربح مقرها سويسرا، تهدف إلى تمكين وتعزيز الثقة الرقمية للنظام البيئي في مجال الرعاية الصحية من خلال منصة مفتوحة المصدر موحدة وموثوقة. تعزز PLA التعاون وتسريع الابتكار وتبني الأفكار لتحقيق فوائد متبادلة في مجالات الرعاية الصحية والعلوم الحياتية للمرضى والأشخاص ذات العلاقة. تم تشكيل PLA في عام 2022 لمواصلة عمل مشروع فارما ليدجر، وهو مشروع مدته 3 سنوات تموله المفوضية الأوروبية والصناعات الدوائية، ويهدف إلى إظهار أهمية حلول بلوكتشين وقيمتها. المزيد من المعلومات متوفرة عبر الموقع at https://pharmaledger.org.</p><h2>ما هي داتا ماتركس؟</h2><p>إنه نوع من أنواع الباركود يوجد على عبوة منتجك الدوائي. فهو باركود على شكل صندوق مربع أبيض وأسود اللون وسيبدو مشابهًا لهذا: <br>    <img src=\"./images/barcode_example.png\"></p><h2>كيفية استخدام التطبيق؟</h2><p>اتبع التعليمات الموجودة على صفحة الهبوط الخاصة بالتطبيق ... حيث يتم عرض صورة لكيفية العثور على الداتا ماتركس الموجود على عبوة منتجك.  بمجرد العثور على الداتا ماتركس، انقر فوق الزر \"امسح داتا ماتركس\".  ثم اسمح للتطبيق باستخدام الكاميرا حتى يمكن مسح الداتا ماتركس.  استخدم الكاميرا لزيادة التركيز على الداتا ماتركس. فبمجرد مسح العبوة بنجاح، سيتم عرض <b>EPI</b>. يمكنك النقر فوق الزر \"+\" للحصول على مزيد من التفاصيل.</p><h2>لماذا لا يعطي مسح الداتا ماتركس أي نتيجة؟</h2><p>هناك عدة أسباب لعدم ظهور EPI بعد مسح الداتا ماتركس الموجود على عبوة منتجك. قد يكون أحد الأسباب هو عدم تركيز الكاميرا جيدا. يرجى محاولة مسح الكود في مكان جيد الإضاءة بحيث يكون ظاهر بوضوح على الشاشة.  إذا كنت تجد صعوبة في الحفاظ على يدك ثابتة، فيمكنك تجربة استخدام طاولة لجعلها ثابتة.</p></div>",
